        return new Source("{% extends '@EasyjetUman/Base/structure.html.twig' %}
{% import \"@EasyjetSwissinsideCore/Base/macros.html.twig\" as macros %}

{% block title %}Adding an App{% endblock %}

{% block specificJs %}{{ parent() }}

{% endblock specificJs %}


{% block container %}

<div id=\"content\">
    <div id=\"content-header\">
        <h1 id=\"titre_help\">Add Application</h1>
        <div id=\"description_help\">This page will allow you to manage new applications, once created you can manage the types of users who will access this application.</div>
    </div>

    <div class=\"row\">
        <div class=\"col-xs-12\">
            {{ macros.wizz() }}
        </div>
    </div>

    {{ form_start(form, {'attr': {'class': 'form-horizontal'}} ) }}

    <div class=\"row\">

        <div class=\"col-xs-12\">
            <div class=\"widget-box\">
                <div class=\"widget-title\">
                    <span class=\"icon\">
                        <i class=\"icon-th\"></i>
                    </span>
                    <h5>Application Details</h5>
                </div>
                <div class=\"widget-content nopadding\">
                    <div class=\"form-group\">
                        <label class=\"control-label\">{{ form_label(form.initiaux) }} :</label>
                        <div class=\"controls\">
                            {{ form_widget(form.initiaux, { 'attr': {'class': 'form-control'} } ) }}
                        </div>
                    </div>

                    <div class=\"form-group\">
                        <label class=\"control-label\">{{ form_label(form.nom) }} :</label>
                        <div class=\"controls\">
                            {{ form_widget(form.nom, { 'attr': {'class': 'form-control'} } ) }}
                        </div>
                    </div>

                    <div class=\"form-group\">
                        <label class=\"control-label\">{{ form_label(form.description) }} :</label>
                        <div class=\"controls\">
                            {{ form_widget(form.description, { 'attr': {'class': 'form-control'} } ) }}
                        </div>
                    </div>
       
                    <div class=\"form-actions\">
                        <input type=\"submit\" class=\"btn btn-primary\" />
                    </div>

                </div>
            </div>
        </div>
    </div>

    {{ form_end(form) }}
    
</div>

{% endblock container %}
